import React from 'react';
import Button from '../../components/Button';

const tracks = [
  {
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    entryFee: 0,
    ranking: [
          {
            name: 'First',
            win: 5
          }
    ],
    color: '#15a13a',
    icon: '...',
    button: <Button name='Entry Free' icon='...' color='#15a13a' />
  },
  {
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    color: '#bf9713',
    icon: '...',
    button: <Button name='Track #1' icon='...' color='#bf9713' />
  },
  {
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    color: '#bf8013',
    icon: '...',
    button: <Button name='Track #2' icon='...' color='#bf8013' />
  },
  {
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    color: '#bf6913',
    icon: '...',
    button: <Button name='Track #3' icon='...' color='#bf6913' />
  },
  {
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    color: '#bf3e13',
    icon: '...',
    button: <Button name='Track #4' icon='...' color='#bf3e13' />
  }
];

export default tracks;
